import "./R5c2Copy.css";

const R5c2Copy = ({ onClose }) => {
  return (
    <div className="r5c2-copy-div">
      <div className="r5c2-content-div">
        <span className="r5c2-content-txt-span">
          <p className="vehicle-garbage-truck8">Vehicle: Garbage Truck 2</p>
          <p className="vehicle-garbage-truck8">Sáng:Route1,MCP2</p>
          <p className="chiu-mcp32">Chiều: MCP3</p>
        </span>
      </div>
      <div className="r5c2-text-div">27</div>
    </div>
  );
};

export default R5c2Copy;
